import React from 'react';
import {Link} from "react-router-dom";

export default function Footer(){
    return (
        <div className="container mt-3">
        <div className="row border-top mt-5">
            <h1 className="text-center mt-5 mb-5" style={{color:"#cf2b2b"}}>“LifeConnect — Bridging the gap between hope and help.”</h1>
        </div>
        <div className="row">
            <div className="col-4 text-center">
                <img src="/logo.png" style={{height:"90%" , width:"30%"}}></img>
                <h4 className="text-muted fs-5">“Every Drop Counts. Be a Hero Today.</h4>
            </div>
             <div className="col-8">
             
                     <Link to="/" style={{textDecoration:"none"}} className="text-muted">About</Link>
             
               
             </div>
             
        </div>
        </div>
    )
}
